webpackJsonp([0x7a7e3ee26f02],{4049:function(a,t){a.exports={data:{markdownRemark:{html:'<p>まいったぜ。8月から都内転勤決まっちまったぜ。家から徒歩時間含めて2時間もあるぜ。今までの倍以上だぜ。本当に同人やる暇あるのかどうか激しく微妙だぜ。でも時封城v2落としてでも夢終劇だけは絶対に落とさないぜ。</p>\n<h2>東方キーホルダー(仮称/委託)について</h2>\n<p>夏コミC70にて当サークルが委託で扱う予定の東方キーホルダー(仮称)ですが、<a href="http://hal900.gotdns.com/HAL900page/goods/goods.html">詳細が出ました</a>ので告知しておきます。30個限定、価格は500円となります。</p>\n<h2>今回の更新情報</h2>\n<p>東方弾幕風フレームワークライブラリ『<a href="/tag/flan">Framework of LunAtic Notation</a>』のバージョン0.0jをリリースしました。バージョン0.0jではプレイヤー/スペルスクリプトに対応し、晴れて全種スクリプト対応となりました。また、全種対応のためにカテゴリを一部細分化しました。さらに算術処理・文字列処理・キー入力処理・オブジェクト弾処理・絵画処理を中心に26の関数を新規追加しました。 とりあえずはこの辺でほぼ完成かなぁ…あと細かい機能挙げればキリないが\'Ａ<strong>(拍)とらのあなの所のリンクがきれています</strong> 突然特設ページが消えていたようで。とりあえず<a href="http://www.toranoana.jp/">とらTOP</a>にリンク張りなおしておきましたよ？</p>\n<h2>(拍)ブルアァァァァァーーーー！！！！！！！延期ドマインーーーーーー！！！！(哀×号泣、夢終劇最高の出来を期待してます</h2>\n<p>弾幕風の機能を限界まで縦横無尽に駆使し、微塵の妥協もスポイルも許さない、会心の新作がここに君臨ｓ(老乱怒広告</p>\n<h2>(拍)夏コミ期待してます！ぜひご挨拶に行ってもよいでしょうか？</h2>\n<p>壁の割にはたぶんそんな言うほど混雑しないだろうと思うのでいつでもどーぞ。(ってかウチのサークル過大評価し過ぎだってば……コミケ中の人)きっと名乗り出てもらえれば自分の頭の上にハテナマークがぽこぽこ出てくるかと思うので(←人覚えの悪い⑨でゴメンナサイorz</p>\n<h2>(拍)[チルノでも分かるWeb拍手もどきの簡易使用法]チルノは漢字が読めないんで分からないかと思うんですが！</h2>\n<p>ごめんなさい、きがむいたらひらがなになおしておきます。</p>\n<h2>(拍)ちんぽっぽ！ちんぽっぽじゃないか！</h2>\n<p>（；＞＜） ＜わからないんです！</p>',frontmatter:{cover:null,date:"2006-07-29T00:00:00+09:00",strDate:"2006/7/28",title:"転勤"}}},pathContext:{path:"/ja/blog/2006/07/29-%e8%bb%a2%e5%8b%a4/",langKey:"ja"}}}});
